List new offices created by year<p>I have a collection with a list of OfficeLicensePurchases.</p>
<p>In that list I need to count how many Offices were created in each year.</p>
<p>And I know that by the earliest license object.</p>
<p>Since the OfficeId is unique, if I have more than one license object for a Office, I just have to count the oldest one. That would mean the year when that Office was created in the database.</p>
<p>So I have:</p>
<pre><code>[
  {
    &quot;_id&quot;: &quot;514de62f-0a4c-46c8-ba66-5692935f0930&quot;,
    &quot;OfficeId&quot;: &quot;09ac58f0-8d2a-42ec-ba47-f518dd9d0904&quot;,
    &quot;PlanName&quot;: &quot;Plan 50&quot;,
    &quot;PlanPrice&quot;: 777,
    &quot;PaidValue&quot;: 330,
    &quot;CreationDate&quot;: {
      &quot;$date&quot;: &quot;2017-03-08T03:00:00.000Z&quot;
    },
    &quot;Status&quot;: 1
  },
  {
    &quot;_id&quot;: &quot;e41a5923-3a69-43bb-87a4-f1169e172e2e&quot;,
    &quot;OfficeId&quot;: &quot;9679fdf7-02a1-4a1f-b0f0-17d3505e86e3&quot;,
    &quot;PlanName&quot;: &quot;Plan 50&quot;,
    &quot;PlanPrice&quot;: 777,
    &quot;PaidValue&quot;: 330,
    &quot;CreationDate&quot;: {
      &quot;$date&quot;: &quot;2019-03-08T03:00:00.000Z&quot;
    },
    &quot;Status&quot;: 1
  },
  {
    &quot;_id&quot;: &quot;d314a8bf-0147-4aee-8357-f36db686c85a&quot;,
    &quot;OfficeId&quot;: &quot;eab54926-0c11-4c9f-aee2-7fbeabad4135&quot;,
    &quot;PlanName&quot;: &quot;Plan 50&quot;,
    &quot;PlanPrice&quot;: 777,
    &quot;PaidValue&quot;: 330,
    &quot;CreationDate&quot;: {
      &quot;$date&quot;: &quot;2021-03-08T03:00:00.000Z&quot;
    },
    &quot;Status&quot;: 2
  }
]
</code></pre>
<p>Expected Result:</p>
<pre><code>[
 {CreationYear: 2018, NewOffices: 1},
 {CreationYear: 2019, NewOffices: 1},
 {CreationYear: 2021, NewOffices: 1}
]
</code></pre>

