Sort rather than _id and apply pagination using last record id on that in mongod and nodeJs<p>I'm applying **filtering **on my data using three different filters mentioned in my code.
this is my code</p>
<pre><code>/* Initialize pipeline */
        const pipeline = [];

        /* All reviews of Auth Host */
        pipeline.push({
            $match: { host_id: new ObjectId(host_id) },
        });

        /* High rated on top */
        if (filter &amp;&amp; filter == &quot;Highest Rated&quot;) {
            pipeline.push({
                $sort: {
                    rating: -1,
                    _id: -1,
                },
            });
        } else if (filter &amp;&amp; filter == &quot;Newest&quot;) {
            /* Newest on top */
            pipeline.push({
                $sort: {
                    _id: -1,
                },
            });
        } else if (filter &amp;&amp; filter == &quot;Oldest&quot;) {
            pipeline.push({
                $sort: {
                    _id: 1,
                },
            });
        }
/* Pagination */
        if (last_rec_id) {
            let query;
            if (filter !== &quot;Highest Rated&quot;) {
                query = filter === &quot;Oldest&quot; || !filter ? { $gt: new ObjectId(last_rec_id) } : { $lt: new ObjectId(last_rec_id) };

                pipeline.push({
                    $match: {
                        _id: query,
                    },
                });
            } else {
                query = {
                    $or: [
                        { rating: { $lte: 5 } },
                        {
                            rating: 5,
                            _id: { $lt: new ObjectId(last_rec_id) }, // Secondary sorting by _id
                        },
                    ],
                };
                pipeline.push({
                    $match: query,
                });
            }
        }
</code></pre>
<p>All filters are working well with pagination but the pagination using **last_rec_id **is not applying on <strong>filter=&quot;Highest Rated&quot;</strong>, i'm getting records well but when i apply pagination it donot give accurate results,</p>

